import React, {useEffect,useState} from 'react';
import axios from 'axios';
import { NavLink } from 'react-router-dom';

const HomePage = () => {

    const [list,setList] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:3001/api/get').then((response) => {
            setList(response.data);
        });
    }, []);

    return(
        <div className="container col-md-6 mt-5 mb-5 p-3 bg-info card shadow rounded">
            <div className="col-md-2">
                <h4>Hii User</h4>
                <NavLink className="nav-link" exact to="/contactpage">Add Post</NavLink>
            </div>
            {
                list.map((val) => {
                    return <h1>Name : {val.firstname} || Password: {val.password}</h1>
                })
            }
        </div>
    )
}

export default HomePage;
